import React from 'react';
import PopCard from './PopCard';
import './CardListStyles.scss';

const CardList = ({ popinfo }) => {
	return(
		<div className='info-preview'>
			{
				popinfo.map((artist, i) => {
					return (
						<PopCard 
						key={i} 
						id={popinfo[i].id} 
						name={popinfo[i].name} 
						song={popinfo[i].song}
						album={popinfo[i].album}
						date={popinfo[i].date} 
						/>
					);
				})
			}
	   </div> 
	);
}

export default CardList;
